INSERT INTO `pages` VALUES (1,'en',1,0,'terms','Terms','terms','Terms & Conditions',NULL,'<h4><b>Definitions</b></h4><p>Each of the terms mentioned below have in these Conditions of Sale LaraClassified Service (hereinafter the \"Conditions\") the following meanings:</p><ol><li>Announcement&nbsp;: refers to all the elements and data (visual, textual, sound, photographs, drawings), presented by an Advertiser editorial under his sole responsibility, in order to buy, rent or sell a product or service and broadcast on the Website and Mobile Site.</li><li>Advertiser&nbsp;: means any natural or legal person, a major, established in France, holds an account and having submitted an announcement, from it, on the Website. Any Advertiser must be connected to the Personal Account for deposit and or manage its ads. Ad first deposit automatically entails the establishment of a Personal Account to the Advertiser.</li><li>Personal Account&nbsp;: refers to the free space than any Advertiser must create and which it should connect from the Website to disseminate, manage and view its ads.</li><li>LaraClassified&nbsp;: means the company that publishes and operates the Website and Mobile Site {YourCompany}, registered at the Trade and Companies Register of Cotonou under the number {YourCompany Registration Number} whose registered office is at {YourCompany Address}.</li><li>Customer Service&nbsp;: LaraClassified means the department to which the Advertiser may obtain further information. This service can be contacted via email by clicking the link on the Website and Mobile Site.</li><li>LaraClassified Service&nbsp;: LaraClassified means the services made available to Users and Advertisers on the Website and Mobile Site.</li><li>Website&nbsp;: means the website operated by LaraClassified accessed mainly from the URL <a href=\"http://www.bedigit.com\">http://www.bedigit.com</a> and allowing Users and Advertisers to access the Service via internet LaraClassified.</li><li>Mobile Site&nbsp;: is the mobile site operated by LaraClassified accessible from the URL <a href=\"http://www.bedigit.com\">http://www.bedigit.com</a> and allowing Users and Advertisers to access via their mobile phone service {YourSiteName}.</li><li>User&nbsp;: any visitor with access to LaraClassified Service via the Website and Mobile Site and Consultant Service LaraClassified accessible from different media.</li></ol><h4><b>Subject</b></h4><p>These Terms and Conditions Of Use establish the contractual conditions applicable to any subscription by an Advertiser connected to its Personal Account from the Website and Mobile Site.<br></p><h4><b>Acceptance</b></h4><p>Any use of the website by an Advertiser is full acceptance of the current Terms.<br></p><h4><b>Responsibility</b></h4><p>Responsibility for LaraClassified can not be held liable for non-performance or improper performance of due control, either because of the Advertiser, or a case of major force.<br></p><h4><b>Modification of these terms</b></h4><p>LaraClassified reserves the right, at any time, to modify all or part of the Terms and Conditions.</p><p>Advertisers are advised to consult the Terms to be aware of the changes.</p><h4><b>Miscellaneous</b></h4><p>If part of the Terms should be illegal, invalid or unenforceable for any reason whatsoever, the provisions in question would be deemed unwritten, without questioning the validity of the remaining provisions will continue to apply between Advertisers and LaraClassified.</p><p>Any complaints should be addressed to Customer Service LaraClassified.</p>',NULL,6,7,1,NULL,NULL,0,0,1,'2017-02-10 11:10:40','2017-02-13 15:22:30'),(2,'fr',1,0,'terms','CGU','cgu','Conditions d\'utilisation et de vente',NULL,'<p><b>Définitions</b><br></p><p>Chacun des termes mentionnés ci-dessous aura dans les présentes Conditions Générales d\'Utilisation et de Vente du Service LaraClassified (ci-après dénommées les « CGU/CGV ») la signification suivante :</p><ol><li>Annonce : désigne l\'ensemble des éléments et données (visuelles, textuelles, sonores, photographies, dessins), déposé par un Annonceur sous sa responsabilité éditoriale exclusive, en vue d\'acheter, de louer ou de vendre un bien ou un service et diffusé sur le Site Internet et le Site Mobile.</li><li>Annonceur : désigne toute personne physique ou morale, majeure, établie en États-Unis, titulaire d\'un Compte et ayant déposé une Annonce, à partir de celui-ci, sur le Site Internet. Tout Annonceur doit impérativement être connecté à son Compte Personnel pour déposer et gérer sa ou ses Annonces. Tout premier dépôt d’annonce entraîne automatiquement la création d’un Compte Personnel propre à l’Annonceur.</li><li>Compte Personnel : désigne l\'espace gratuit que tout Annonceur doit se créer et auquel il doit se connecter depuis le Site Internet, afin de diffuser, gérer et visualiser ses annonces.</li><li>LaraClassified : désigne la société qui édite et exploite le Site Internet et le Site Mobile {YourCompany}, immatriculée au registre du commerce et des sociétés de Cotonou sous le numéro {YourCompany Registration Number} dont le siège social est situé {YourCompany Address}.</li><li>Service client : désigne le service de LaraClassified auprès duquel l\'Annonceur peut obtenir toute information complémentaire. Ce service peut être contacté par e-mail en cliquant sur le lien présent sur le Site Internet et le Site Mobile.</li><li>Service LaraClassified : désigne les services LaraClassified mis à la disposition des Utilisateurs et des Annonceurs sur le Site Internet et le Site Mobile.</li><li>Site Internet : désigne le site internet exploité par LaraClassified accessible principalement depuis l\'URL <a href=\"http://www.bedigit.com\">http://www.bedigit.com</a> et permettant aux Utilisateurs et aux Annonceurs d\'accéder via internet au Service LaraClassified.</li><li>Site Mobile : désigne le site mobile exploité par LaraClassified accessible depuis l\'URL <a href=\"http://www.bedigit.com\">http://www.bedigit.com</a> et permettant aux Utilisateurs et aux Annonceurs d\'accéder via leur téléphone mobile au Service LaraClassified.</li><li>Utilisateur : désigne tout visiteur, ayant accès au Service LaraClassified via le Site Internet et le Site Mobile et consultant le Service LaraClassified accessible depuis les différents supports.</li></ol><p><b>Objet</b></p><p>Les présentes Conditions Générales d\'Utilisation et de Vente (CGU/GCV) établissent les conditions contractuelles applicables à toute souscription, par un Annonceur connecté à son Compte Personnel depuis le Site Internet et le Site Mobile.</p><p><b>Acceptation</b></p><p>Toute utilisation du site du Site par un Annonceur vaut acceptation pleine et entière des CGU/CGV en vigueur.</p><p><b>Responsabilité</b></p><p>La responsabilité de LaraClassified ne peut être engagée en cas d\'inexécution ou de mauvaise exécution de la commande due, soit du fait de l\'Annonceur, soit d\'un cas de force majeure.</p><p><b>Modification des Conditions</b></p><p>LaraClassified se réserve la possibilité, à tout moment, de modifier en tout ou partie les CGV.<br>Les Annonceurs sont invités à consulter régulièrement les CGV afin de prendre connaissance des changements apportés.</p><p><b>Dispositions Diverses</b></p><p>Si une partie des CGV devait s\'avérer illégale, invalide ou inapplicable, pour quelque raison que ce soit, les dispositions en question seraient réputées non écrites, sans remettre en cause la validité des autres dispositions qui continueront de s\'appliquer entre les Annonceurs et LaraClassified.</p><p>Toute réclamation doit être adressée au Service Client de LaraClassified.</p>',NULL,6,7,1,NULL,NULL,0,0,1,'2017-02-10 11:10:40','2017-02-13 15:22:30'),(3,'es',1,0,'terms','Términos','terminos','Términos y Condiciones',NULL,'<h4 style=\"margin-left: 0px;\"><b>Definitions</b></h4><p>Each of the terms mentioned below have in these Conditions of Sale LaraClassified Service (hereinafter the \"Conditions\") the following meanings:</p>